CREATE TABLE `evaluation_log` (
  `id` decimal(22,9) DEFAULT NULL,
  `classifier_name` varchar(255) DEFAULT NULL,
  `creation_date` datetime DEFAULT NULL,
  `end_date` datetime DEFAULT NULL,
  `evaluation_method` varchar(255) DEFAULT NULL,
  `evaluation_status` varchar(255) DEFAULT NULL,
  `ip_address` varchar(255) DEFAULT NULL,
  `start_date` datetime DEFAULT NULL,
  `instances_info_id` decimal(22,9) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

